-- ----------------------------
-- Table structure for wsxd_case
-- ----------------------------
DROP TABLE IF EXISTS `wsxd_case`;
CREATE TABLE `wsxd_case`  (
  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '物理主键',
  `data_date` date NOT NULL COMMENT '数据日期',
  `app_org` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '进件机构 01:网商 02:玖康 03:分蛋 04:嘉禾 05: 机构一商润贷 app:app',
  `department_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '事业部编号',
  `department_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '事业部',
  `loan_orgin` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '放款机构code',
  `cust_level` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户级别',
  `app_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '申请编号',
  `contract_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '合同编号',
  `loan_bill_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '借据编号',
  `case_label` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '案件标签(正常,理赔,代偿,核销)',
  `case_status` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '案件状态(常规逾期,正常还款,已结清)',
  `source_core` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '案件来源核心(01:银数、02:安硕、03:创新）',
  `customer_name` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '客户姓名',
  `customer_id_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '客户证件号',
  `manager_id` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户经理编号',
  `manager_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户经理名称',
  `team_manager_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '团队经理名称',
  `overdue_count` int(11) NULL DEFAULT NULL COMMENT '历史逾期次数',
  `is_first_overdue` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否首次逾期 0:否 1:是',
  `loan_date` date NULL DEFAULT NULL COMMENT '放款日期',
  `due_date` date NULL DEFAULT NULL COMMENT '到期日期',
  `bill_date` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '账期',
  `loan_terms` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '总期数（贷款期限）',
  `loan_prin` decimal(20, 2) NULL DEFAULT NULL COMMENT '贷款本金',
  `interest` decimal(20, 2) NULL DEFAULT NULL COMMENT '贷款利息',
  `is_settle` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否已还清 0:否 1:是',
  `loan_term_fee` decimal(20, 2) NULL DEFAULT NULL COMMENT '手续费',
  `account_fee` decimal(20, 2) NULL DEFAULT NULL COMMENT '服务费',
  `current_debt` decimal(20, 2) NULL DEFAULT NULL COMMENT '当前欠款',
  `loan_balance` decimal(20, 2) NULL DEFAULT NULL COMMENT '贷款余额',
  `last_interest` decimal(20, 2) NULL DEFAULT NULL COMMENT '剩余利息',
  `last_loan_balance` decimal(20, 2) NULL DEFAULT NULL COMMENT '剩余手续费',
  `last_account_fee` decimal(20, 2) NULL DEFAULT NULL COMMENT '剩余服务费',
  `overdue_start_date` date NULL DEFAULT NULL COMMENT '逾期开始日期',
  `overdue_start_term` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '逾期开始期数',
  `overdue_term` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '逾期期数',
  `overdue_prin` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期本金',
  `overdue_int` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期利息',
  `overdue_fee` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期手续费',
  `overdue_account_fee` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期账户管理费',
  `overdue_late_fee` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期违约金',
  `overdue_penalty` decimal(20, 2) NULL DEFAULT NULL COMMENT '罚息',
  `overdue_compound` decimal(20, 2) NULL DEFAULT NULL COMMENT '复利',
  `overdue_days` int(11) NULL DEFAULT NULL COMMENT '逾期天数',
  `overdue_amt` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期金额',
  `realtime_overdue_days` int(11) NULL DEFAULT NULL COMMENT '逾期天数（接口）',
  `realtime_overdue_amt` decimal(20, 2) NULL DEFAULT NULL COMMENT '逾期金额（接口）',
  `app_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '产品类型(数仓不推送)',
  `app_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '产品名称',
  `case_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '案件类型(内催,委外,诉讼,仲裁)',
  `present_date` date NULL DEFAULT NULL COMMENT '当前日期',
  `appoint_start` date NULL DEFAULT NULL COMMENT '委案开始日期',
  `appoint_end` date NULL DEFAULT NULL COMMENT '委案结束日期',
  `mark1` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注1',
  `mark2` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注2',
  `create_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp(0) NULL DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '删除标记 默认 0-正常 1-删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

